import React from 'react';
import '../Dashboard/Dashboard.css';
import { Link } from ''
import {IconContext} from 'react-icons/lib';

function Dashboard() {
  return (
    <IconContext.Provider value={{color: "#fff"}}>
      <div className='Nav'>
        <Link to='#'>
          <FaIcons.FaBars />
        </Link>
      </div>
    </IconContext.Provider>
  )
}

export default Dashboard
